◆こちらの商品<strong><span style="color: #ff0000;">受注生産品</span></strong>となります。<strong><span style="color: #ff0000;">オーダーから2ヶ月</span></strong>ほどかかります。 <br />◇他の商品と併せてご購入の場合、<strong><span style="color: #ff0000;">受注生産品が入荷後の同時発</span></strong>送となります。予めご了承くださいませ。<br /><br /><hr /><span style="color: #ff0000;"><strong>【予約受付中】【完全受注生産】</strong></span><br /><hr /><span style="color: #008000;"><strong>Megabass/メガバス</strong>　</span><br /><hr /><span style="color: #ff6600;"><strong>ARMS Super Leggera/アームズスーパーレジェーラ　</strong></span><br /><hr /><span style="color: #3366ff;"><strong>ASL7206X</strong></span><br /><hr />◆長さ：7.2ft<br />◆ルアー：3/8-2oz<br />◆ライン：12-30b<br />◆リールシートスペーサー：4-AXISIS Carbon<br /><hr />
<div><span style="color: #ff00ff;"><strong>【SUPER LEGGERAとは】</strong></span><br />ARMSはF-1マシンと同じ。メガバスロッドを進化させるべく伊東のロッドテクノロジーをいちはやく具現化させるテストベットであり、</div>
<div>近未来のメガバス・ロッドビジョンを先行投影させる、ドリームワークスです。</div>
<div>2015年。伊東の最先端テクノロジーを具現化するアイティオーエンジニアリングが、<br />驚愕のフィッシングダイナミクスを内包する「スーパーウエポン」を、フィールドに送り出します。</div>
<div>荷重を受けるガイドセクションに高密度コンポジットしたマイクロブレイデッドグラファイトファイバーが想定ターゲットの大きさを物語る、<br />新開発「異軸多弾性ハイブリッドグラファイトコンポジット」ブランクスは、これまでのバスロッドのスペックを凌駕。</div>
<div>超軽量カーボンフレームを覗かせるハニカムフレーム構造のロッキングダイヤルは、<br />極限までのブランキング（肉抜き）が施された軽量化構造であると共に、圧倒的な強度を実現。</div>
<div>自由度の高いフルアングルキャストを実現させるロープロファイル・ショートトリガーに接合されたITOリールシートスペーサーは、<br />「ウォールナット（ウッド）」・「バーズアイピーコック（ウッド）」・「4-AXISISカーボン」・「BRAIDED WOVENカーボン」・「METALコンポジットカーボン」の５種類。</div>
<div>そのスーパーウエポンの名は、「SUPER LEGGERA」。</div>
<div>ARMSテクノロジーが、またしてもバスロッドの未来を変えていきます。</div>
<hr />
<div>マットカヴァーにアプローチするフロッグゲーム、<br />へヴィブッシュに潜むモンスターをジグ＆テキサスで攻略する圧巻のハイパワーシャフトが、ついに、ARMSワールドに降臨。</div>
<div>I-SLIDEによるビッグベイトゲームや、スーパーディープコンタクトでは圧巻のリフティングパワーと卓越したコントローラビリティをいかんなく発揮。</div>
<hr /><span style="color: #ff00ff;"><strong>【テーラーメイドプログラム仕様】</strong></span><br />・TMP OP1(ベースモデル)：ASL6904X<br />・TMP OP2(itoカーボンハンドル)：左投げ用or右投げ用<br /><strong>※キャスト時の投げ手でお選びください</strong><br />・TMP OP3(トップガイドスレッド)：アームズロッソ<br />・TMP OP4(ハンドルリングレベルスペーサー)：スペチアーレゴールド<br />・TMP OP5(itoカーボンハンドル仕上げ)：艶有グロスコート+ゴールドシグネチャー<br />・TMP OP6(ブランクス)：アンサンドYOLOYブランクス+シグネチャー<br /><hr /><style>
